import React from 'react';

function LandingPage(): JSX.Element {
    return (
        <>
            <svg viewBox="0 0 1000 1000">
                <circle cx="200" cy="200" r="100" stroke="blue" fill="none" />
                <circle cx="200" cy="300" r="100" stroke="blue" fill="none" />
                <circle cx="200" cy="400" r="100" stroke="blue" fill="none" />
                <circle cx="200" cy="500" r="100" stroke="blue" fill="none" />
                <circle cx="300" cy="350" r="100" stroke="blue" fill="none" />
                <circle cx="300" cy="250" r="100" stroke="blue" fill="none" />
            </svg>
            <div>Landing page</div>
        </>
    );
}

export default LandingPage;
